eval("__webpack_require__.r(__webpack_exports__);\n/* harmony default export */ __webpack_exports__[\"default\"] = (\"Facebook lanz React en 2013. Es una biblioteca de cdigo abierto para proyectos de JavaScript, que permite a los desarrolladores crear aplicaciones web e interfaces de usuario. A pesar de ser relativamente nueva, React se ha vuelto enormemente popular y ha ganado una gran comunidad.\\r\\n\\r\\nReact tiene una gran variedad de beneficios para los desarrolladores. Algunos de ellos son:\\r\\n\\r\\nEs fcil de aprender.\\r\\nEs fcil de usar con un proyecto.\\r\\nEs flexible.\\r\\nTiene componentes reutilizables.\\r\\nEs de alto rendimiento.\\r\\nEs flexible.\\r\\nMejora la productividad.\\r\\nOfrece estabilidad de cdigo.\\r\\nOfrece muchas herramientas para el desarrollador.\\r\\nTiene un vasto ecosistema.\\r\\nFacilita un fuerte desarrollo web.\\r\\nMuchas de las principales empresas del mundo, incluidas varias empresas de Fortune 500, utilizan React.\\r\\n<img src=\\\"https://www.educative.io/v2api/editorpage/6452289848475648/image/5294398307303424\\\" alt=\\\"\\\" className=\\\"card-img-top\\\" />\\r\\n\\r\\n<h1>Cero configuracin</h1>\\r\\nNext.js logra proveer de un entorno de cero configuracin asumiendo unas pocas cosas sobre la estructura de tu aplicacin en el sistema de archivos, una de estas es que necesitamos crear una carpeta pages en la raz de nuestro proyecto y cada archivo dentro de esa carpeta va a ser una ruta.\\r\\n\\r\\nGracias a esto Next.js nos provee de un sistema de rutas, separacin de cdigo por ruta, actualizaciones de cdigo sin necesidad de recargar y no tener que configurar nuestros entry points de WebPack ya que Next.js ya sabe donde buscar nuestros archivos.\\r\\n\\r\\nSolo JavaScript, todo es una funcin\\r\\nCada ruta de nuestra aplicacin no es ms que un archivo de JavaScript que exporta un componente de React, el cual puede ser tan simple como una funcin y puede a su vez importar ms componentes hechos sencillamente con funciones para que nuestra aplicacin no sea otra cosa ms que muchas funciones compuestas.\\r\\n\\r\\nIncluso cuando se trata de estilizar nuestra aplicacin Next.js nos provee de un sistema de CSS en JS llamado styled-jsx (creado especialmente para Next.js) que nos permite escribir nuestros estilos directo en JS haciendo uso de todo el poder de CSS.\\r\\n\\r\\nLo mejor de styled-jsx? Slo genera el CSS necesario para los componentes renderizados (tanto en el servidor como en el cliente) y una vez un componente se deja de usar se quita su CSS, nunca vamos a tener ms CSS del necesario y todo este va a estar hecho especficamente para nuestros componentes, es imposible que se pisen estilos.\\r\\n\\r\\n\\r\\n\\r\\n<h1>Deploy sencillo</h1>\\r\\nCmo hacemos para llevar nuestra aplicacin a produccin? Con slo correr el comando next build que nos da el framework ya tenemos una carpeta (llamada .next) con el cdigo listo para produccin, subimos eso a un servidor (el que sea) y corremos next start y listo.\\r\\n\\r\\nAn ms fcil? Con now.sh simplemente configuramos los comandos build y start para que ejecuten next build y next start respectivamente y luego corremos now desde nuestra computadora, en unos minutos vamos a tener nuestra aplicacin en produccin, con HTTP/2 y auto escalable.\\r\\n\");//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./data/blog-post.4.md\n");

